import React from 'react';
import makeStyles from "@material-ui/core/styles/makeStyles";
import Iframe from "react-iframe";
import Grid from "@material-ui/core/Grid";
import Divider from "@material-ui/core/Divider";
import DualPane from "../utlilty/DualPane";
import InfoCard from "../utlilty/InfoCard";
import trek_lake from "../images/Hobbies/Trek_Lake.jpg";
import trek_finish from "../images/Hobbies/Trek_Finish.jpg";

const useStyles = makeStyles(theme => ({
    videos: {
        justifyContent: 'space-evenly'
    },
    grid_text: {
        padding: 20
    }
}));

export default function Trekking() {
    const classes = useStyles();
    return (
        <div>
            <DualPane src1={trek_lake} src2={trek_finish}/>
            <Grid className={classes.grid_text} container justify="space-evenly" spacing={3}>
                <Grid item xs={6}>
                    <InfoCard>
                        <ul>
                            <li> From a young age, I loved mountains. This stemmed from my dad's passion for it,
                                and he would often take me along. </li>
                            <li> Have trekked around the world, including
                                India, Australia, and Nepal. </li>
                            <li> My largest trek was the <i>Annapurna Circuit</i> in Nepal at the age of 14.</li>
                        </ul>
                    </InfoCard>
                </Grid>
                <Grid item xs={6}>
                    <InfoCard anec>
                        I was once recorded playing the piano at the campus dorms for a film student's project!
                        I've met people with interesting backgrounds and experience in the campus piano room.
                        <br/><br/> My favourite pieces to play include:
                        <ul>
                            <li><i> La La Land: Epilogue</i></li>
                            <li><i> Firth of Fifth (Genesis)</i></li>
                        </ul>
                    </InfoCard>
                </Grid>
            </Grid>
        </div>
    );
}
